So you’ve tried every spray, mousse, powder and potion to attempt to create extra volume in your hair but it still falls flat minutes after styling. It may seem counter intuitive, but it can sometimes be especially difficult to keep volume if you have thick hair because it weighs itself down SO easily. And fine hair has its own challenges with limpness and flatness!

This is when your haircut needs to step in and get truly crafted to do some of the heavy lifting for you. Talk to your stylist about adding some short layers all around the crown section of your head. You want the layers to wrap around from the sides and into the back because no one wants pretty volume in the front & flat hair from behind. You don’t have to go into full on shag territory if you don’t want to, but adding crown layers is the #1 way I’ve achieved lasting volume in my hair. They create little sections of lift that make all of my products perform 10x better and they are easier to style and spray up while maintaining all of the luxurious length underneath! 

Hair cut by @ernestomeneses 

